import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Works from '../components/Works';
import WorkInfo from '../components/WorkInfo';

// Components
import Header from '../components/Header';
import Footer from '../components/Footer';

// Pages
import PageHome from '../pages/PageHome';
import PageAbout from '../pages/PageAbout';
import PageNotFound from '../pages/PageNotFound';
import PageWorkDetail from '../pages/PageWorkDetail';

// Styles
import '../scss/styles.scss';

export class AppRouter extends Component {
  render() {
    return (
      <Router>
          <Header />
          <Switch>
            <Route exact path="/"><PageHome /></Route>
            <Route exact path= "/work" component={Works} />
            <Route exact path= "/work/:id" component={WorkInfo} />
            <Route exact path="work/:id"><PageWorkDetail/></Route>
            <Route path="/about"><PageAbout /></Route>
            <Route path="/"><PageNotFound /></Route>
          </Switch>
          <Footer />
      </Router>
    )
  }
}

export default AppRouter;
